import { useState } from 'react';
import t from './tabs.module.css'

const Tabs = () => {
    const [activeTab, setActiveTab] = useState("races")
    return (
        <ul className={t.tabs}>
            <li className={activeTab === "races" ? "active" : ""}>Заезды</li>
            <li className={t.option}>Лошади</li>
            <li className={t.option}>Жокеи</li>
        </ul>
    )
}

export default Tabs
